import React from 'react';
// 추가
import PropTypes from 'prop-types';

/* Content.js */
// 2) export default 배보시킬 클래스명~ <-> Angular(export class 클래스명)
export default class Content extends React.Component{

    render(){
        return(
        <div>
            <h1>{this.props.body}</h1>
            <img src='data:image/png;base64,' />
        </div>
        );
    }
}

/*
props를 못받았을 경우 에러메시지 출력
형식) 자식클래스명.propTypes = {
    매개변수명 : PropTypes.자료형(string(소문자)), 
    매개변수명2 : PropTypes.자료형(string).isRequired(필수전달), 
}
*/
Content.propTypes = {
    body : PropTypes.string.isRequired
}

//export default Content;
